import collections


def find_anagrams(s, p):
    result = []
    result_map = {}

    for i in range(len(s) - len(p) + 1):
        result_map[s[i:len(p) + i]] = i

    return result


def find_anagrams_v2(s, p):
    ans = []
    count = collections.Counter(p)
    required = len(p)

    for r, c in enumerate(s):
        count[c] -= 1

        # 如果不是在p中，到这里count[c] < 0
        if count[c] >= 0:
            required -= 1
        if r >= len(p):
            count[s[r - len(p)]] += 1
            if count[s[r - len(p)]] > 0:
                required += 1
        if required == 0:
            ans.append(r - len(p) + 1)

    return ans


print(find_anagrams_v2("cbaebabacd", "abc"))
